import React from "react";
import OrderConfirmed from "./Components/Orderconfirmed";
import { styled } from "styled-components";
const App = () => {
  const H1 = styled.h1`
    background-color: #ce2829;
    text-align: center;
    margin: 0;
    color: white;
  `;
  return (
    <>
      <H1>Teknolojik Yemekler</H1>
      <OrderConfirmed />
    </>
  );
};
export default App;
